import Head from 'next/head';


export default function Layout({ children }) {
  return (
    <div>
      <Head>
        <title>InfoCasas</title> 
      </Head>
      <Navbar />
      <main>
        {children}
      </main>

      <style jsx global>
        {`
          html,
          body {
            padding: 0;
            margin: 0;
          }
          * {
            box-sizing: border-box;
          }
        `}
      </style>
    </div>
  )
}

